import React from "react";
import "./ListTweet.scss";

const ListTweet = (props) => {
  const { allTweets } = props;

  if (!allTweets || allTweets.length === 0) {
    return <div className="divListTweet">No Hay Tweets</div>;
  } else {
    return allTweets.map((tweet, index) => {
      <div className="grid-container">
        <div className="grid-item">Tweet 1</div>
        <div className="grid-item">Tweet 2</div>
        <div className="grid-item">Tweet 3</div>
        <div className="grid-item">Tweet 4</div>
        <div className="grid-item">Tweet 5</div>
        <div className="grid-item">Tweet 6</div>
      </div>;
    });
  }
};

export default ListTweet;
